import React from 'react'
import "./style.scss";
import gsap from 'gsap';
import {FaGithub} from 'react-icons/fa';
import {GrLinkedin,GrMail} from "react-icons/gr";
import {VscFileSubmodule, VscChecklist,VscAccount,VscArrowUp,VscFeedback} from "react-icons/vsc";



export default function Navbar() {
    
    var toggle = false;

    function slideOpen() {
      
        toggle=!toggle;
        if (toggle){
            gsap.to('#menu-btn',{xPercent:0, opacity:1
            })
        }
        else {
            gsap.to('#menu-btn',{xPercent:-200})
        }
    }


    
    return (
        <div className="navbar" data-scroll-section>
            <div>
                <ul>
                    <div class="menu" id="menu" onClick={slideOpen}>
                        Menu
                    </div>
                    <div id="menu-btn">
                        <li><VscArrowUp/>Back to top</li>
                        <li><VscAccount/>About</li>
                        <li><VscChecklist/>Skills</li>
                        <li><VscFileSubmodule/>Projects</li>
                        <li ><VscFeedback/>Feedback</li>
                    </div>
                </ul>
            </div>
            <div id="icons">
                <a href="https://github.com/joicejoseph3198" target="_blank" rel="noopener noreferrer"><FaGithub id="git"/></a>
                <a href="https://www.linkedin.com/in/joice-v-joseph-85311a1a1/" target="_blank" rel="noopener noreferrer"><GrLinkedin id="linkd"/></a>
                <a href="your link here" target="_blank" rel="noopener noreferrer"><GrMail id="mail"/></a>
            </div>
        </div>
    )



    
}
